import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-q3-val',
  templateUrl: './q3-val.component.html',
  styleUrls: ['./q3-val.component.css']
})
export class Q3ValComponent implements OnInit{
  TopPerGames: TopPerGame[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
    private router: Router,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getTopPerGame(1)
      .subscribe(TopPerGames => this.TopPerGames = TopPerGames);
  }
}
